import { Router, Switch, Route } from 'react-router-dom';

import Home from './components/Home';
import './App.scss';

function App() {
  return (
    <Router>
      <Switch>
      <Route exact path="/" component={Home} />
      </Switch>
    </Router>
  );
}

export default App;
